import { useParams } from "react-router-dom";
import robots from "../data/robots";

const RobotDetailsWrapper = ({ children }) => {
    const { id } = useParams();
    const robot = robots.find((robot) => robot.id === Number(id));

    return children(robot);
};

export default RobotDetailsWrapper;
